import { useCallback } from 'react';

export const useSound = () => {
  const playCorrectSound = useCallback(() => {
    const audio = new Audio();
    audio.src = 'data:audio/wav;base64,';
    audio.volume = 0.3;
    audio.play().catch(() => {});
  }, []);

  const playWrongSound = useCallback(() => {
    const audio = new Audio();
    audio.src = 'data:audio/wav;base64,';
    audio.volume = 0.3;
    audio.play().catch(() => {});
  }, []);

  return {
    playCorrectSound,
    playWrongSound
  };
};